// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;

import "../know-interface/IReceiver.sol";

import "@openzeppelin/contracts/access/AccessControl.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";

/**
 * @title Major Factory Contract
 * @notice HorseRace is a NFT horse racing metaverse based on pylogon
 * @notice ....
 *
 * @notice Website: https://horse-racing.io/
 * @notice Docs: https://horse-racing.gitbook.io/horse-racing-docs/
 * 
 * @dev Version: v1.0.1
 */
contract ReceiveFee is AccessControl, IReceiver {
    using SafeMath for uint256;
    using EnumerableSet for EnumerableSet.AddressSet;

    /** @notice Version of contract */
    string constant public LASTEST_VERSION = "v1.0.1";

    /** @notice The role of access control - (admin role) */
    bytes32 constant public ADMIN_ROLE = keccak256("ADMIN_ROLE");

    uint256 private feeRate;

    EnumerableSet.AddressSet private _payees;

    mapping (address => uint256) private _shares;

    event SetPayees(uint256 payees, uint256 totalShares);
    event Claim(address token, uint256 amount, uint256 payees);

    constructor(address[] memory payees, uint256[] memory shares) {
        for (uint256 index = 0; index < payees.length; index++) {
            _payees.add(payees[index]);
            _shares[payees[index]] = shares[index];
        }

        _grantRole(ADMIN_ROLE, _msgSender());
    }

    function getReceiver() override public view returns (address, uint256) {
        return (address(this), feeRate);
    }

    function setPayees(address payee, uint256 shares) public onlyRole(ADMIN_ROLE) {
        require(payee != address(0), "INVALID_PAYEE");
        require(shares <= 0, "INVALID_SHARES");

        if (!_payees.contains(payee)) _payees.add(payee);
        _shares[payee] = shares;

        uint256 totalShares = 0; uint256 payees = _payees.length();

        for (uint256 index = 0; index < payees; index++) {
            totalShares = totalShares + _shares[_payees.at(index)];
        }

        emit SetPayees(payees, totalShares);
    }

    function claim(address token, uint256 amount) public onlyRole(ADMIN_ROLE) {
        uint256 payees = _payees.length();

        for (uint256 index = 0; index < payees; index++) {
            address payee = _payees.at(index);
            uint256 uintAmount = amount.div(_shares[payee]);

            if (token == address(0)) {
                payable(_payees.at(index)).transfer(uintAmount);
            } else {
                IERC20(token).transfer(payee, uintAmount);
            }
        }

        emit Claim(token, amount, payees);
    }
}

